class LRUCache:
    class _Node:
        def __init__(self, key, val):
            self.key = key
            self.val = val
            self.next = None

    def __init__(self, capacity):
        self.capacity = capacity
        self.head = LRUCache._Node(None, None)
        self.tail = self.head
        self.cache = {}

    def reconstruct(self, pre_node):
        node = pre_node.next
        pre_node.next = node.next
        self.cache[node.next.key] = pre_node
        self.tail.next = node
        self.tail = node

    def remove_head(self):
        head = self.head.next
        self.cache[head.next.key] = self.head
        self.cache.pop(head.key)
        self.head.next = head.next

    def get(self, key):
        if self.tail.key == key:
            return self.tail.val
        pre_node = self.cache.get(key, None)
        if pre_node:
            res = pre_node.next.val
            self.reconstruct(pre_node)
        else:
            res = -1
        return res

    def put(self, key, value):
        if self.tail.key == key:
            self.tail.val = value
            return
        pre_node = self.cache.get(key, None)
        if pre_node:
            pre_node.next.val = value
            self.reconstruct(pre_node)
        else:
            node = LRUCache._Node(key, value)
            self.cache[key] = self.tail
            self.tail.next = node
            self.tail = node
            if len(self.cache) > self.capacity:
                self.remove_head()


